import { Fragment } from "react";
import styled from "styled-components";

export const TodoLi = styled.li`
  display: flex;
  flex-direction: row;
  align-items: center;
`;
export const TodoText = styled.p`
  width: 229px;
  height: 24px;
  font-family: "Pretendard";
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
  letter-spacing: -1px;
  color: #666666;
`;
export const DeleteBtn = styled.img`
  cursor: pointer;
`;

export const Todo = () => {
  return (
    <Fragment>
      <TodoLi>
        <input type={"radio"} />
        <TodoText>테스트 텍스트입니다</TodoText>
        <img src="img/close_btn.svg" alt="닫기 버튼"></img>
      </TodoLi>
    </Fragment>
  );
};
